import React, {useState} from 'react';
import './App.css';


function App()  {

  const [gifs, setGifs] = useState(['https://media3.giphy.com/media/datwfu4nZbjIiNPmDO/giphy.gif?cid=ecf05e47b6e8cf2fd6c02d082036fe0acbe1df1210e58bc4&rid=giphy.gif&ct=v']);

  return (
    <div className="App">
      <section className ="App-content">
          <img src={gifs} />
      </section>
    </div>
  );
}


export default App;
